query:
SELECT DISTINCT ?uri
WHERE {
  ?uri <http://www.w3.org/1999/02/22-rdf-syntax-ns#type> <http://dbpedia.org/ontology/Actor> .
  { ?uri <http://es.dbpedia.org/property/lugarDeNacimiento> <http://es.dbpedia.org/resource/Alemania> . }
  UNION
  { ?uri <http://es.dbpedia.org/property/lugarDeNacimiento> ?lugar .
    FILTER regex(?lugar,'Alemania') }
}

SELECT DISTINCT ?uri 
WHERE {
	?pelicula <http://www.w3.org/1999/02/22-rdf-syntax-ns#type> <http://dbpedia.org/ontology/Film> .
        ?pelicula <http://es.dbpedia.org/property/producción> ?uri .
} 
ORDER BY DESC(COUNT(?pelicula)) LIMIT 1


SELECT DISTINCT ?uri
WHERE {
 { ?uri <http://es.dbpedia.org/property/ocupación> <http://es.dbpedia.org/resource/Poeta> . }
 UNION
 { ?uri <http://es.dbpedia.org/property/ocupación> ?o .
   FILTER regex(?o,'poeta','i') }
 { ?uri <http://es.dbpedia.org/property/lugarNacimiento> <http://es.dbpedia.org/resource/España> . }
 UNION
 { ?uri <http://es.dbpedia.org/property/lugarNacimiento> ?l .
   ?l <http://dbpedia.org/ontology/country> <http://es.dbpedia.org/resource/España> . }
}


SELECT DISTINCT ?uri
WHERE {
  ?uri <http://es.dbpedia.org/property/club> <http://es.dbpedia.org/resource/Deportivo_de_La_Coruña> .
  ?uri <http://es.dbpedia.org/property/fechadenacimiento> ?f .
}
ORDER BY DESC(?f) OFFSET 0 LIMIT 1


SELECT DISTINCT ?uri
WHERE {
  ?uri <http://es.dbpedia.org/property/elevación> ?e .
  ?uri <http://es.dbpedia.org/property/isla> <http://es.dbpedia.org/resource/Gran_Canaria> .
}
ORDER BY DESC(?e) OFFSET 0 LIMIT 1

SELECT DISTINCT ?uri 
WHERE {
	?uri <http://dbpedia.org/ontology/orderInOffice> '5th President of the United States'@en .
}

SELECT DISTINCT ?uri 
WHERE { 
	?uri <http://www.w3.org/1999/02/22-rdf-syntax-ns#type> <http://dbpedia.org/ontology/Country>  .
        ?uri <http://dbpedia.org/property/officialLanguages> ?language .
} 
ORDER BY DESC(COUNT(?language)) LIMIT 1

SELECT DISTINCT ?uri 
WHERE { 
	?uri <http://www.w3.org/1999/02/22-rdf-syntax-ns#type> <http://dbpedia.org/ontology/Mountain>  .
        ?uri <http://dbpedia.org/ontology/elevation> ?elevation .
} 
ORDER BY DESC(?elevation) LIMIT 1

SELECT DISTINCT ?uri 
WHERE {
	?uri <http://www.w3.org/1999/02/22-rdf-syntax-ns#type> <http://dbpedia.org/class/yago/StatesOfTheUnitedStates> .
        ?uri <http://dbpedia.org/property/densityrank> ?rank .
} 
ORDER BY ASC(?rank) LIMIT 1

SELECT DISTINCT ?uri
WHERE { 
	?uri <http://www.w3.org/1999/02/22-rdf-syntax-ns#type> dbo:Company  .
	?uri <http://dbpedia.org/property/industry> res:Aerospace .
        ?uri <http://dbpedia.org/property/industry> res:Nuclear_reactor_technology .
}

SELECT DISTINCT ?uri
WHERE { 	
	?uri  <http://www.w3.org/1999/02/22-rdf-syntax-ns#type> <http://dbpedia.org/ontology/Organisation>  .
	{ ?uri <http://dbpedia.org/property/industry> <http://dbpedia.org/resource/Telecommunications> . } UNION { ?uri <http://dbpedia.org/property/industry> ?industry . FILTER (regex(?industry, 'Telecommunication')) . }
	{ ?uri <http://dbpedia.org/ontology/location> <http://dbpedia.org/resource/Belgium.> } UNION { ?uri <http://dbpedia.org/property/location> <http://dbpedia.org/resource/Belgium.> } UNION { ?uri <http://dbpedia.org/property/location>Country 'Belgium'@en . }
}

SELECT DISTINCT ?uri 
WHERE {
      ?uri <http://www.w3.org/1999/02/22-rdf-syntax-ns#type> <http://dbpedia.org/ontology/VideoGame> .
      { ?uri <http://dbpedia.org/property/publisher> 'Mean Hamster Software'@en . }
      UNION 
      { ?uri <http://dbpedia.org/ontology/publisher> res:Mean_Hamster_Software . }
}

SELECT DISTINCT ?uri 
WHERE { 
	?uri <http://www.w3.org/1999/02/22-rdf-syntax-ns#type> <http://dbpedia.org/ontology/Airport> .
      { ?uri <http://dbpedia.org/ontology/location> <http://dbpedia.org/resource/California> . }
      UNION
      { ?uri <http://dbpedia.org/property/location> <http://dbpedia.org/resource/California> . } 
      UNION 
      { ?uri <http://dbpedia.org/ontology/city> <http://dbpedia.org/resource/California> . } 
      UNION 
      { ?uri <http://dbpedia.org/ontology/city> ?city .
        ?city <http://dbpedia.org/ontology/isPartOf> <http://dbpedia.org/resource/California> . }
      UNION
      { ?uri <http://dbpedia.org/ontology/operator> <http://dbpedia.org/resource/California> . } 
      UNION 
      { ?uri <http://dbpedia.org/property/cityServed> <http://dbpedia.org/resource/California> . } 
}

SELECT DISTINCT ?uri 
WHERE {
	{ ?uri <http://www.w3.org/1999/02/22-rdf-syntax-ns#type> <http://dbpedia.org/ontology/President> . }
	UNION
	{ ?uri <http://www.w3.org/1999/02/22-rdf-syntax-ns#type> <http://dbpedia.org/class/yago/Presidents> . }
        ?uri <http://dbpedia.org/ontology/birthDate> ?date .
	FILTER regex(?date, '^1945') .
}

SELECT DISTINCT ?uri 
WHERE {
	?uri <http://www.w3.org/1999/02/22-rdf-syntax-ns#type> <http://dbpedia.org/ontology/Organisation> .
      { ?uri <http://dbpedia.org/ontology/formationYear> ?date . }
      UNION 
      { ?uri <http://dbpedia.org/ontology/foundingYear> ?date. }
      UNION
      { ?uri <http://dbpedia.org/property/foundation> ?date . } 
      UNION
      { ?uri <http://dbpedia.org/property/formation> ?date . } 
      FILTER regex(?date,'^1950') . 
}

SELECT DISTINCT ?uri 
WHERE { 
	?uri <http://www.w3.org/1999/02/22-rdf-syntax-ns#type> <http://dbpedia.org/class/yago/StatesOfTheUnitedStates> .
	?uri <http://dbpedia.org/property/admittancedate> ?x .
}
ORDER BY DESC(?x) OFFSET 0 LIMIT 1

SELECT DISTINCT ?uri 
WHERE {
        ?uri <http://www.w3.org/1999/02/22-rdf-syntax-ns#type> <http://dbpedia.org/ontology/FormulaOneRacer> .
	?uri <http://dbpedia.org/ontology/races> ?x .
}
ORDER BY DESC(?x) OFFSET 0 LIMIT 1

SELECT DISTINCT ?uri 
WHERE {
        ?uri <http://www.w3.org/1999/02/22-rdf-syntax-ns#type> <http://dbpedia.org/ontology/River> .
        ?uri <http://dbpedia.org/property/length> ?x .
}
ORDER BY DESC(?x) OFFSET 0 LIMIT 1

SELECT DISTINCT ?uri 
WHERE {
	?uri <http://www.w3.org/1999/02/22-rdf-syntax-ns#type> <http://dbpedia.org/ontology/Mountain> .
	?uri <http://dbpedia.org/ontology/elevation> ?elevation .
}
ORDER BY DESC(?elevation) OFFSET 1 LIMIT 1
